import React, { Component } from 'react';
import { connect } from 'react-redux';
import { loadSurvey } from '../../../action/survey';
class FillSurvey extends Component {
  componentDidMount() {
    props.loadSurvey('MySecondSeker');
  }
  render() {
    return <div>FILL SURVEY COMPONENT</div>;
  }
}

export default connect(null, { loadSurvey })(FillSurvey);
